              <img
                className="absolute bg-black h-full w-full"
                src={arr1}
                alt=""
              />
              <div className="m-4 absolute text-white bottom-0">
                <h1>Playstation 5</h1>
                <Link className="underline">Shop Now</Link>
              </div>
            </div>
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"Accessories"} heading={"Electronics Accessories"} />
          <div className="grid grid-cols-3 gap-10">
            <AccessoryCard />
            <AccessoryCard />
            <AccessoryCard />
          </div>
        </div>
        <div className="flex justify-evenly">
        <ServiceCard />


        </div>
